import React from 'react';
import { Container, NavWrapper, Nav, NavItem, SpecialNavItem, Logo, LogoSection } from '../styled/HeaderStyle';
import logoImage from '../img/BigLogo.png';

export default function Header() {
    return (
        <Container>
            <LogoSection>
                <img src={logoImage} style={{ height: '40px' }} alt="DaonTech 로고" />
                <Logo to="/">DaonTech</Logo>
            </LogoSection>
            <NavWrapper>
                <Nav>
                    <NavItem to="/">회사 소개</NavItem>
                    <NavItem to="/about">제품 소개</NavItem>
                    <NavItem to="/projects">자료실</NavItem>
                    <NavItem to="/projects">커뮤니티</NavItem>
                    <SpecialNavItem href="http://daon.womsbrt.com/" target="_blank">
                        그룹웨어
                    </SpecialNavItem>
                </Nav>
            </NavWrapper>
        </Container>
    );
}
